import React from 'react';
import CardBlockShop from '../Utils/CardBlockShop'

const LoadMoreCards = (props) => {
  return (
    <div>
    	<div>
      		LoadMoreCards
      		<CardBlockShop 
      			grid={props.grid}
      			list={props.products}
      		/>
      	</div>
      	<div className='load_more_container'>
          <span onClick={() => props.loadMore()}>
            Load More
          </span>
        </div>
    </div>

  )
}
export default LoadMoreCards;
